using namespace std;
using namespace Magick;

static pthread_mutex_t imagemutex = PTHREAD_MUTEX_INITIALIZER;
static pthread_mutex_t intmutex = PTHREAD_MUTEX_INITIALIZER;
//Image sought;
Image sought("test.jpg");
#define NUM_THREADS   8


struct thread_data{
	int xcoor;
	int ycoor;
	boost::multiprecision::mpz_int exponent;
};

boost::multiprecision::mpz_int restore = 0;
boost::multiprecision::mpz_int * pointer = &restore;

void *quartimg(void *threadarg){
	struct thread_data *my_data;
	my_data = (struct thread_data *) threadarg;

	pthread_mutex_lock (&imagemutex);
	Pixels pixcache(sought);
	pthread_mutex_unlock (&imagemutex);
	PixelPacket* pixpax;
	pixpax = pixcache.get(my_data->xcoor,my_data->ycoor,160,208);
	unsigned int blue, green, red = 0;
	boost::multiprecision::mpz_int total = 0;

    //160*208=33280
    //33280*NUM_THREADS=266240
    //266240 = 640*416[pixcel]

    for (unsigned pixcel=0; pixcel<33280; pixcel++) {
	blue = (pixpax->blue + 2184)/4369;
	green = (pixpax->green  + 2184)/4369;
	red = (pixpax->red  + 2184)/4369;
	total += (blue + (16*green) + (256*red))*(my_data->exponent);
	my_data->exponent = my_data->exponent << 12;
	pixpax++;
    }

	pthread_mutex_lock (&intmutex);
	*pointer+=total;
	pthread_mutex_unlock (&intmutex);
	pthread_exit(NULL);
}

int main() {
	if(sought.columns() != 640 || sought.rows() != 416){
		cout << "unsupported iamge size" << endl;
		return 0;
	}

	pthread_t threads[NUM_THREADS];
	struct thread_data td[NUM_THREADS];
	int rc;
	boost::multiprecision::mpz_int expo = 1;

	for(int thread=0; thread<NUM_THREADS; thread++ ){
		td[thread].xcoor=(160*(thread%4));
		td[thread].ycoor=(208*(thread/4));
		td[thread].exponent = expo;
		expo = expo << 399361;
		rc = pthread_create(&threads[thread], NULL, quartimg, (void *)&td[thread]);
		cout << "thread:" << thread << endl;
		cout << " xcoor:" << td[thread].xcoor << endl;
		cout << " ycoor:" << td[thread].ycoor << endl;
	}

	for (int thread=0; thread<NUM_THREADS; thread++) {
		void *status;
		pthread_join(threads[thread],&status);
	}
	
	boost::multiprecision::mpz_int reverser;
	boost::multiprecision::mpz_int * revp = &reverser;

	*pointer ^=(*pointer >> 1797118);
	*revp = *pointer^((*pointer % masktwo) << 1497599);
	*pointer = *pointer^((*revp % masktwo) << 1497599);
	*revp = *pointer^((*pointer % maskone) << 698879);
	*revp = *pointer^((*revp %maskone) << 698879);
	*revp = *pointer^((*revp %maskone) << 698879);
	*revp = *pointer^((*revp %maskone) << 698879);
	*pointer = *pointer^((*revp %maskone) << 698879);
	*revp = *pointer^(*pointer >> 1098239);
	*revp = *pointer^(*revp >> 1098239);
	*pointer = *pointer^(*revp >> 1098239);

	*pointer = (ainverse*(*pointer-c))%m;
	if (*pointer<0) {*pointer += m;}


	//cout << "*pointer:" << *pointer << endl;
	
	ofstream writing_file;
	writing_file.open("./pointer.txt", ios::out);
	writing_file << *pointer;
}
